import React from 'react';

const Skills = () => {
  const skillCategories = [
    {
      title: "Cloud Platforms",
      skills: ["AWS", "EC2", "S3", "RDS", "Lambda", "CloudWatch", "Cost Optimization"]
    },
    {
      title: "Infrastructure as Code",
      skills: ["Terraform", "CloudFormation", "Ansible", "Helm Charts"]
    },
    {
      title: "Container & Orchestration",
      skills: ["Docker", "Kubernetes", "EKS", "ECR", "Container Security"]
    },
    {
      title: "CI/CD & DevOps",
      skills: ["GitHub Actions", "Jenkins", "GitLab CI", "ArgoCD", "Pipeline Automation"]
    },
    {
      title: "Monitoring & Observability",
      skills: ["Dynatrace", "Prometheus", "Grafana", "ELK Stack", "CloudWatch"]
    },
    {
      title: "Databases & Analytics",
      skills: ["PostgreSQL", "MySQL", "MongoDB", "Redis", "Tableau", "Data Pipeline"]
    },
    {
      title: "Scripting & Programming",
      skills: ["Python", "Bash", "PowerShell", "YAML", "JSON", "Go"]
    },
    {
      title: "Security & Compliance",
      skills: ["IAM", "Security Groups", "SSL/TLS", "Vulnerability Scanning", "Compliance"]
    }
  ];

  return (
    <section id="skills" className="skills">
      <div className="container">
        <h2>Technical Expertise</h2>
        <div className="skills-grid">
          {skillCategories.map((category, index) => (
            <div key={index} className="skill-category">
              <h3>{category.title}</h3>
              <ul className="skill-list">
                {category.skills.map((skill, skillIndex) => (
                  <li key={skillIndex} className="skill-item">{skill}</li>
                ))}
              </ul>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Skills;
